	public boolean isTableExist(String sTablename,Connection connection) throws SQLException{
	    if(connection!=null)
	    {
	        DatabaseMetaData dbmd = connection.getMetaData();
	        ResultSet rs = dbmd.getTables(null, null, sTablename.toUpperCase(),null);
	        if(rs.next())
	        {
	            System.out.println("Table "+rs.getString("TABLE_NAME")+" already exists ----- Skipping");
	            return true;
	        }
	        else
	        {
	            return false;
	        }
	    }
		return false;
	}
	
	
	private String eeNameTable(String type)
	{
		return "CREATE TABLE " +  type  + " (id int,name varchar(255),eeStatusYN boolean,gender varchar(1))";
	}
	
	private String eeSurnameTable(String type)
	{
		return "CREATE TABLE " +  type  + " (id int,surname varchar(255),eeStatusYN boolean)";
	}
	
	private String eeCostCentreTable(String type)
	{
		return "CREATE TABLE " +  type  + " (id int not null generated always as identity (start with 1, increment by 1),name varchar(255))";
	}
	
	private String userTable(String type)
	{
		
		return "CREATE TABLE " +  type  + " (id int not null generated always as identity (start with 1, increment by 1),userProperty varchar(255),datepreference int,passportDetail boolean,includeCostCentre boolean, includeDepartments boolean,includeDivisions boolean,includePayPoint boolean,paymentRate int, employmentType int)";
		
	}
	
	private String costCentreSettingsTable(String type)
	{
		return "CREATE TABLE " +  type  + " (userprofile int,fixed boolean,fixedvalue int)";
		
	}
	
	private String dateSettingsTable(String type)
	{
		
		return "CREATE TABLE " +  type  + " (userProfile int,employmentDate date,engagementDate date,irp5Date date,firstPayInterval date,startDate date,endDate date,jobTitleEffectiveDate date,jobGradeEffectiveDate date)";
		
	}
	
	private String updateTable(String table,String file,boolean eeStatusYN,String gender) throws IOException
	{
		 InputStream is = BootstrapDB.class.getResourceAsStream(file);
		 List<String> sqlList = new ArrayList<String>();

		 BufferedReader br = null;

		 br = new BufferedReader(new InputStreamReader(is));
		 try 
		 {
			 String line;
			 while ((line = br.readLine()) != null) 
			 {
				 sqlList.add(line);
			 }
		}
		finally
		{
			is.close();
			br.close();
		}
		
		int id = 0;
		List<String> bodyElements = new ArrayList<String>();
		bodyElements.addAll(sqlList);
		bodyElements.remove(sqlList.size() -1);
		StringBuilder insertSQL = new StringBuilder("insert into " + table + " values ");
		if (!gender.equals(""))
		{
			
			for (int x = 0; x < bodyElements.size();x++)
			{
				
				insertSQL.append("(" + id + ",'" + bodyElements.get(x) + "'," + eeStatusYN + ",'" + gender + "'),"  );
				id++;
			}
		
			insertSQL.append("(" + id + ",'" + sqlList.get(id) + "'," + eeStatusYN + ",'" + gender + "')"  );
		}
		else 
		{
			for (int x = 0; x < bodyElements.size();x++)
			{
				
				insertSQL.append("(" + id + ",'" + bodyElements.get(x) + "'," + eeStatusYN + "),"  );
				id++;
			}
		
			insertSQL.append("(" + id + ",'" + sqlList.get(id) + "'," + eeStatusYN + ")"  );
			
		}
		System.out.println(insertSQL.toString());
		return insertSQL.toString();
		
	}
	
